import React, { useState } from "react";
import { Link, NavLink } from "react-router-dom";
import "./Menu.css";

const Menu = () => {
  const [activeDropdown, setActiveDropdown] = useState(null);
  const [menuOpen, setMenuOpen] = useState(false);

  const menu = [
    {
      section: "sobre-nos",
      isButton: false
    },
    {
      title: "Programação",
      dropdownItems: [
        { label: "Palestras", path: "/palestras" },
        { label: "Workshops", path: "/workshops" },
        { label: "Oficinas", path: "/oficinas" },
        { label: "Shows e Performance", path: "/shows" },
      ],
      isButton: false
    },
    {
      title: "Visitação",
      link: "/",
      isButton: false
    },
    {
      section: "expositores",
      isButton: true
    },
    {
      section: "parceiros",
      isButton: true
    },
  ];

  function renderMenuItem(item, index) {
  if (item.section) {
    return (
      <li key={index}>
        <p
          className="li-button"
          onClick={() => handleScroll(item.section)}
        >
          {item.section}
        </p>
      </li>
    );
  } else {
    if (item.isButton) {
      return (
        <li key={index}>
          <button
            className="li-button btn-prog"
            onClick={() => handleDropdownClick(index)}
          >
            {item.title}
          </button>
          {activeDropdown === index && (
            <ul className="dropdown-menu show">
              {item.dropdownItems.map((dropdownItem, dropdownIndex) => (
                <li key={dropdownIndex}>
                  <NavLink
                    className="li-link-dropdown"
                    to={dropdownItem.path}
                    activeClassName="active"
                    onClick={handleLinkClick}
                  >
                    {dropdownItem.label}
                  </NavLink>
                </li>
              ))}
            </ul>
          )}
        </li>
      );
    } else {
      return (
        <li className="li-link" key={index}>
          <Link
            to={item.link}
            className="li-links-title"
            onClick={handleLinkClick}
          >
            {item.title}
          </Link>
        </li>
      );
    }
  }
}


  function handleDropdownClick(index) {
    setActiveDropdown(activeDropdown === index ? null : index);
  }

  function handleLinkClick() {
    setActiveDropdown(null);
    setMenuOpen(false);
  }

  function handleMenuIconClick() {
    setMenuOpen(!menuOpen);
  }

  function handleScroll(sectionId) {
    const section = document.getElementById(sectionId);
    section.scrollIntoView({ behavior: "smooth" });
  }

  return (
    <div>
      <div className="menu-icon-div">
        <button className="menu-icon" onClick={handleMenuIconClick}>
          <span></span>
          <span></span>
          <span></span>
        </button>
      </div>
      <ul className={`ul-menu ${menuOpen ? "show" : ""} div-li-buttons`}>
        <li>
          <button
            className="li-button"
            onClick={() => handleScroll("sobre-nos")}
          >
            Sobre Nós
          </button>
        </li>
        <li>
          <button
            className="li-button"
            onClick={() => handleScroll("expositores")}
          >
            Expositores
          </button>
        </li>
        <li>       
          <button
            className="li-button btn-par"
            onClick={() => handleScroll("parceiros")}

          >
            Parceiros
          </button>
        </li>
        {menu.map((item, index) =>
          item.type === "link" ? (
            <li className="li-link" key={index}>
              <Link
                to={item.link}
                className="li-links-title"
                onClick={handleLinkClick}
              >
                {item.title}
              </Link>
            </li>
          ) : (
            <li key={index}>
              {activeDropdown === index && (
                <ul className="dropdown-menu show">
                  {item.dropdownItems.map((dropdownItem, dropdownIndex) => (
                    <li key={dropdownIndex}>
                      <NavLink
                        className="li-link-dropdown"
                        to={dropdownItem.path}
                        activeClassName="active"
                        onClick={handleLinkClick}
                      >
                        {dropdownItem.label}
                      </NavLink>
                    </li>
                  ))}
                </ul>
              )}
              <button
                className="li-button btn-prog"
                onClick={() => handleDropdownClick(index)}
              >
                {item.title}
              </button>
            </li>
          )
        )}
      </ul>
    </div>
  );

};

export default Menu;
